import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link, useNavigate } from 'react-router-dom'; // Import necessary Router components


// Dummy Data
const dummyCars = [
    { id: 1, title: 'Tesla Model S', imageUrl: 'https://via.placeholder.com/400x250', description: 'Electric sedan with autopilot.' },
    { id: 2, title: 'Ford Mustang', imageUrl: 'https://via.placeholder.com/400x250', description: 'Classic muscle car with a powerful engine.' },
    { id: 3, title: 'Toyota Supra', imageUrl: 'https://via.placeholder.com/400x250', description: 'Sports car known for its speed.' },
];

const App = () => {
    const [cars, setCars] = useState(dummyCars);

    const addCar = (newCar) => setCars([...cars, newCar]);
    const deleteCar = (id) => setCars(cars.filter(car => car.id !== id));
    const editCar = (updatedCar) => setCars(cars.map(car => car.id === updatedCar.id ? updatedCar : car));

    return (
        <Router>
            <div>
                <nav>
                    <Link to="/" style={{ margin: '10px' }}>Home</Link>
                    <Link to="/create" style={{ margin: '10px' }}>Create Car</Link>
                </nav>

                <Routes>
                    {/* Route for Product List */}
                    <Route 
                        path="/" 
                        element={<ProductList cars={cars} />}
                    />

                    {/* Route for Product Creation */}
                    <Route 
                        path="/create" 
                        element={<ProductCreation addCar={addCar} />}
                    />

                    {/* Route for Product Detail page */}
                    <Route 
                        path="/product/:id" 
                        element={<ProductDetail cars={cars} deleteCar={deleteCar} editCar={editCar} />}
                    />
                </Routes>
            </div>
        </Router>
    );
};

export default App;
